class Sm3naSongsResponseModel {
  Sm3naSongsResponseModel({
      String? start, 
      String? filter, 
      List<Songs>? songs,}){
    _start = start;
    _filter = filter;
    _songs = songs;
}

  Sm3naSongsResponseModel.fromJson(dynamic json) {
    _start = json['start'];
    _filter = json['filter'];
    if (json['songs'] != null) {
      _songs = [];
      json['songs'].forEach((v) {
        _songs?.add(Songs.fromJson(v));
      });
    }
  }
  String? _start;
  String? _filter;
  List<Songs>? _songs;

  String? get start => _start;
  String? get filter => _filter;
  List<Songs>? get songs => _songs;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    map['start'] = _start;
    map['filter'] = _filter;
    if (_songs != null) {
      map['songs'] = _songs?.map((v) => v.toJson()).toList();
    }
    return map;
  }

}

